import styled from 'styled-components';

const Aboutus = styled.aboutus`
    margin-top: 100px;
`

const AboutUs = () => {
    return ( 
        <Aboutus>
            <div className = 'AboutUs'>
                <h1>AboutUs</h1>
            </div>
        </Aboutus>
    );
}
 
export default AboutUs;
